import React, {useState} from 'react'
import noteContext from './noteContext';




const noteState = (props=>{

    const [note,setNote]=useState([]);




    return (
        <noteContext.Provider value={note}>
            {props.children}
        </noteContext.Provider>
    )

})

export default noteState;
